import { Component } from 'react';

export default function Navbar() {
    return (
        <nav className="navbar navbar-expand-lg navbar-light" style = {{backgroundColor: '#DEA80A'}}>
            <div class="container-fluid">
            <span class="navbar-brand mb-0 h1">CLASS HUB</span>
            <div class="d-grid gap-2 d-md-flex justify-content-md-end">
                <button class="btn btn-primary me-md-2" type="button" data-bs-toggle="modal" data-bs-target="#loginPopup">LOGIN</button>
                <button class="btn btn-primary" type="button" data-bs-toggle="modal" data-bs-target="#registerPopup">REGISTER</button>
            </div>
        </div>
        </nav>
    
    )

}
